import React from "react";
import ReactDOM from "react-dom";
import Sdata from "./Sdata";
import Card from "./Card";
import "./index.css";


ReactDOM.render(
    <>
    <h1 className="heading_style"> Top 5 Best Netflix Series in 2020</h1> 
    {Sdata.map((val) => {
        return (
        <Card 
         key =  {val.id}
         imgsrc ={val.imgscr}
         title ={val.title}
         sname ={val.sname}
         link = {val.link}
    />
        );
    })}
    </>,
    document.getElementById("root")
);
